import React, { Component } from "react";
import GoogleMapReact from "google-map-react";
import Geocode from "react-geocode";
import { Wrapper, Status } from "@googlemaps/react-wrapper";

class Map2 extends Component {
  state = {
    loading: true,
    center: {
      lat: 43.64563,
      lng: -79.39545,
    },
    zoom: 15,
  };

  render() {
    return <div></div>;
  }
}

export default Map2;
